import React from 'react';
import styled from 'styled-components';

const StyledSplashPage = styled.div`
  text-align: center;
  span {
    display: inline-block;
    vertical-align: middle;
    color: black;
    font-size: 2em;
    text-align: center;
  }
`

const SplashPage = () => {
  return (
    <StyledSplashPage>
      <span>
        Create or Join a Room to Get Started
      </span>
    </StyledSplashPage>
  )
}

export default SplashPage;
